message:
⚔️🇷🇺 Últimas atualizações sobre a operação da Rússia na Ucrânia:

▪️ Todas as unidades inimigas avançando na direção de Krasny Liman foram detidas. Mais de 120 militares ucranianos foram neutralizados e três tanques, quatro veículos blindados de combate e quatro caminhonetes foram destruídos;

▪️ A ofensiva das forças ucranianas na direção de Nikolaev-Krivoi Rog foi interrompida como resultado de uma derrota no fogo. Foram neutralizados mais de 60 militares ucranianos e seis veículos blindados de combate e sete veículos foram destruídos;

▪️ Na área da cidade de Pavlograd, na região de Dnepropetrovsk, foi destruída uma empresa ucraniana de produção de combustível sólido de foguetes, explosivos e pólvora para as forças ucranianas;

▪️ Um helicóptero Mi-8 da força aérea ucraniana foi abatido perto de Novotroitskoye, na região de Zaporozhie;

▪️ Os sistemas de defesa aérea da Rússia destruíram quatro veículos aéreos não tripulados durante o último dia.

Siga a @sputnikbrasil para acompanhar todas as notícias envolvendo as tensões na Ucrânia
